pragma solidity 0.6.12;

contract YourContract {
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;
    uint256 public totalSupply;
    string public name;
    string public symbol;
    address public owner;
    mapping(address => uint256) private s_4;
    uint256 private s_5;
    uint160 private s_3_12_32;
    address private s_7_12_32;

    function renounceOwnership() external payable {
        require(msg.sender == owner, "Not the owner");
        owner = address(0);
    }

    function transferOwnership(address newOwner) external payable {
        require(newOwner != address(0), "New owner is the zero address");
        require(msg.sender == owner, "Not the owner");
        owner = newOwner;
    }

    function approve(address spender, uint256 value) external payable {
        require(spender != address(0), "Spender is the zero address");
        allowance[msg.sender][spender] = value;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) external payable {
        require(spender != address(0), "Spender is the zero address");
        require(allowance[msg.sender][spender] >= subtractedValue, "Decreased allowance below zero");
        allowance[msg.sender][spender] -= subtractedValue;
    }

    function increaseAllowance(address spender, uint256 addedValue) external payable {
        require(spender != address(0), "Spender is the zero address");
        require(allowance[msg.sender][spender] + addedValue >= allowance[msg.sender][spender], "Increased allowance above max value");
        allowance[msg.sender][spender] += addedValue;
    }

    function transfer(address recipient, uint256 amount) external payable {
        require(recipient != address(0), "Recipient is the zero address");
        require(balanceOf[msg.sender] >= amount, "Insufficient balance");
        balanceOf[msg.sender] -= amount;
        balanceOf[recipient] += amount;
    }

    function transferFrom(address sender, address recipient, uint256 amount) external payable {
        require(sender != address(0), "Sender is the zero address");
        require(recipient != address(0), "Recipient is the zero address");
        require(balanceOf[sender] >= amount, "Insufficient balance");
        if (allowance[sender][msg.sender] != uint256(-1)) {
            require(allowance[sender][msg.sender] >= amount, "Insufficient allowance");
            allowance[sender][msg.sender] -= amount;
        }
        balanceOf[sender] -= amount;
        balanceOf[recipient] += amount;
    }
}
```

